import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Electronics category card (grid) to appear
    await page.waitForSelector('.category-card', { timeout: 5000 });

    // There may be multiple category cards, find the one with "Electronics"
    const electronicsCard = await page.locator('.category-card', { hasText: 'Electronics' }).first();
    await electronicsCard.waitFor({ state: 'visible', timeout: 5000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_card_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_card_visible.png'));

    // Click the Electronics category card
    await electronicsCard.click();

    // Wait for the category results header to appear (after navigation)
    await page.waitForSelector('h2', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_navigation.png'));

    // Extract the heading text to verify navigation
    const categoryHeading = await page.locator('h2').first().textContent();
    // Also extract the number of products shown in the results-count element
    let resultsCount = '';
    if (await page.locator('.results-count').count() > 0) {
      resultsCount = await page.locator('.results-count').first().textContent();
    }

    return {
      success: true,
      action: "Navigated to Electronics category by clicking the Electronics category card",
      extractedData: {
        categoryHeading: categoryHeading ? categoryHeading.trim() : null,
        resultsCount: resultsCount ? resultsCount.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
